This may have been indirectly fixed by other changes to visibility validation.

A private method with same name as one already implemented via interface causes an error:

```apex
// in the interface
Boolean isEnabled(String a);

// a public implementation
public Boolean isEnabled(String a) {}

// a private with same name but diff params - Error: Method 'xxx' from interface 'yyy' must be public or global
private Boolean isEnabled(List<String> abc) {}
```
